import React from "react";
import img1 from "../assets/img/Screenshot 2023-10-21 142412.png";
import img2 from "../assets/img/chatbot.png";
import AliceCarousel from "react-alice-carousel";
import "react-alice-carousel/lib/alice-carousel.css";

export default function project() {
  const items = [
    <div
      className="item justify-center   items-center flex flex-col"
      data-value="1"
    >
      <img className="  rounded-3xl shadow-2xl" src={img1}></img>
      <div className=" p-5">
        <h1 className=" font-bold  scale-105">Smart Education Based Web App</h1>
        <div className=" flex flex-row">
          <h1>Tech Used : </h1>
          <span> React</span>
        </div>
      </div>
    </div>,

    <div
      className="item justify-center items-center flex flex-col"
      data-value="2"
    >
      <img className=" rounded-3xl shadow-2xl" src={img2}></img>

      <h1>Smart Education</h1>
    </div>,
    <div className="item" data-value="3">
      3
    </div>,
    <div className="item" data-value="4">
      4
    </div>,
    <div className="item" data-value="5">
      5
    </div>,
  ];

  const renderSlideInfo = ({ item, itemsCount }) => {
    return `${item}\\${itemsCount}`;
  };

  const renderDotsItem = ({ isActive }) => {
    return isActive ? "x" : "o";
  };

  const renderPrevButton = ({ isDisabled }) => {
    return <span style={{ opacity: isDisabled ? "0.5" : 1 }}>&lt;</span>;
  };

  const renderNextButton = ({ isDisabled }) => {
    return <span style={{ opacity: isDisabled ? "0.5" : 1 }}>&gt;</span>;
  };

  const renderPlayPauseButton = ({ isPlaying }) => {
    return isPlaying ? "PAUSE" : "PLAY";
  };

  return (
    <div
      id="Project"
      className="max-w-[1090px] mx-auto text-[white] h-[auto]  md:h-[90vh] m-5  p-5 flex flex-col p-2"
    >
      <h1 className=" font-bold text-[30px] flex p-5 float-left my-8">
        <span id="span">3.</span>Some Things I have Built
      </h1>
      <div
        className="  justify-center
       items-center
        flex flex-col  w-[100%]  max-w-[900px] mx-auto"
      >
        <AliceCarousel
          mouseTracking
          items={items}
          disableSlideInfo={false}
          renderDotsItem={renderDotsItem}
          renderPrevButton={renderPrevButton}
          renderNextButton={renderNextButton}
        />
      </div>
    </div>
  );
}
